import './App.css';
import { Header, CollectionCard } from './components';
import { assets } from './constants';
import { useState, useEffect } from 'react';
import axios from 'axios';

//yarn add axios

function App() {
  const [punkListData, setPunkListData] = useState([]);

  useEffect(() => {
    const getMyNfts = async () => {
      const openseaData = await axios.get(
        'https://testnets-api.opensea.io/assets?asset_contract_address=0x63959cbAAa83806564dC0BF0273CD99de5e892CF&order_direction=asc'
      );
      console.log(openseaData.data.assets);
      setPunkListData(openseaData.data.assets);
    };
    return getMyNfts();
  }, []);
  return (
    <div className='app'>
      <Header />
      <CollectionCard
        id={2}
        name={'CPP'}
        traits={[{ value: 8 }]}
        image='https://opensea.mypinata.cloud/ipfs/QmcyfW17Qti9XqPLrxhvP9BuDomfHreB7xWWZGGY1zRuKr/0'
      />
    </div>
  );
}

export default App;
